import './App.css';
import {Routes, Route} from 'react-router-dom'
import StarshipsList from './components/StarshipsList';

function App() {
  return (
    <div className="App">
      <nav>
        <Routes>
          <Route> <StarshipsList/> </Route>
        </Routes>
      </nav>
    </div>
  );
}

export default App;
